import "./App.css";
import React from "react";
import Header from "./Header.js";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
function App() {
  return (
    <Router>
      <Routes>
        <Route path="/matchScouting" element={() => <Header name="value" />} />
      </Routes>
    </Router>
  );
}

export default App;
